import React from 'react';
import API from '../Api';//Cambiar a constantes
import axios from 'axios';
import {DataTable,Column} from 'primereact/datatable';
import {Button} from 'primereact/button';


class BienesApi extends React.Component {
    
    constructor() {
        super();
        this.state = { 
            fiduca: {
                data:[]
            },
            menu: [
                {label: 'View', icon: 'pi pi-fw pi-search', command: (event) => this.viewCar(this.state.selectedCar)},
                {label: 'Delete', icon: 'pi pi-fw pi-times', command: (event) => this.deleteCar(this.state.selectedCar)}
            ] 
        };
        this.viewCar = this.viewCar.bind(this);
        this.deleteCar = this.deleteCar.bind(this);
        
    }

    viewCar(elemento) {
        this.growl.show({severity: 'info', summary: 'Car Selected', detail: elemento.fgarIdFideicomiso});
    }

    deleteCar(elemento) {
        let eleList = [...this.state.fiducia.data];
        eleList = eleList.filter((c) => c.fgarIdFideicomiso !== elemento.fgarIdFideicomiso);

        this.growl.show({severity: 'info', summary: 'Car Delete', detail: elemento.fgarIdFideicomiso});
        /*this.setState({
            fiducia: carsList
        });*/
    }


    llamada() {
        return axios.get('http://127.0.0.1:7101/FiduciaWeb/getRef.do?json={"id":"funRegistroGarantias"}')
               .then(res => res);
    }

    componentDidMount() {
        
        this.llamada().then(data => {
            this.setState({fiduca: data});
        });
        
    }
    
    render() {


        return (
            <div className="datatable-doc-demo">
                <Growl ref={(el) => { this.growl = el; }}></Growl>
                <ContextMenu model={this.state.menu} ref={el => this.cm = el} onHide={() => this.setState({selectedElem: null})}/>       
                <DataTable value={this.state.fiduca.data} 
                    paginator={true} 
                    rows={10} 
                    header={header} 
                    contextMenuSelection={this.state.selectedElem} 
                    onContextMenuSelectionChange={e => this.setState({selectedElem: e.value})}
                    onContextMenu={e => this.cm.show(e.originalEvent)}>
                    <Column field="fgarIdFideicomiso" header="Fideicomiso" sortable={true}/>
                    <Column field="fgarCveGarantia2" header="Garantia"/>
                    <Column field="fgarImpGarantizadFormatted" header="Importe Garantia"/>
                    <Column field="fgarCveStatus" header="Status" filter={true}  />
                </DataTable>
            </div>
        );
    }
}
export default BienesApi;
